import React, { Component } from 'react';
import './App.css';
const Clarifai = require('clarifai');

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      colors: ''
    }
  }
  componentDidMount() {
    const app = new Clarifai.App({apiKey: 'bd8644854b19417dacdfa3adba21aab1'});
    app.models.predict("eeed0b6733a644cea07cf4c60f87ebb7", "https://static.altchar.com/live/media/images/950x633_ct/10596_Resident_Evil_2_MAIN_8bd79736ec3d249e9007668fe2ffd5b7.jpg")
    .then(res => {
      console.log(res.outputs);
    },
    err => {
      console.log(err);
    }
  );
  }

  render() {
    return (
      <div className="App">
        Hello!
      </div>
    );
  }
}

export default App;
